import React from "react";
import OwnerList from "./OwnerList";
import OwnerForm from "./OwnerForm";

const OwnerComponent = ({
  submitOwner,
  ownerNameUpdate,
  ownerCpfUpdate,
  ownerDataUpdate,
  ownerSexoUpdate,
  operationType,
  owners,
  updateOwner,
  deleteOwner,
  getOwnerByCpf,
}) => {

  return (
    <>
      <OwnerForm
        submitOwner={submitOwner}
        ownerNameUpdate={ownerNameUpdate}
        ownerCpfUpdate={ownerCpfUpdate}
        ownerDataUpdate={ownerDataUpdate}
        ownerSexoUpdate={ownerSexoUpdate}
        operationType={operationType}
        updateOwner={updateOwner}
      />
      <OwnerList
        owners={owners}
        updateOwner={updateOwner}
        deleteOwner={deleteOwner}
        getOwnerByCpf={getOwnerByCpf}
      />
    </>
  );
};

export default OwnerComponent;
